import React from "react";
import Footer from "../parts/Footer";
import Navbar from "../parts/Navbar";
import Details from "../parts/Details";

const Steps = () => {
  return (
    <>
      <Navbar />
      <Details />
      <Footer />
    </>
  );
};

export default Steps;
